Description:                               =
============================================

Milkstone Studios presents the next installment in the indie racing series, now with online for 12 players! Drive the 30+ high speed cars on a 3D,weather-changing city! Career mode provides hours of fun, challenging races. You need to tune your car and earn money to get the most wanted cars.Pursuit the top ranks and become the best in the world! Underground racing has never been so fun! Little Racers STREET is a much needed refresh to the top-down racing genre! Offering a whole 3D city with lots of different tracks and enviromental effects, the game's key point is its career mode. You'll have to start from scratch, with a low class car. Win races and complete challenges to earn credits, and spend them upgrading your car or purchasing new ones. Featuring 30 different cars, challenging opponents and varied race conditions, this game offers hours of fun and enjoyment!

